import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useState } from "react";
import { useDispatch } from "react-redux";
import {newUser} from "../reducer/login";

const SignUp=()=>{

    const [userName,setUserName]=useState()
    const [userAge,setUserAge]=useState()
    const [userMail,setUserMail]=useState()
    const [confirmUserMail,setConfirmUserMail]=useState()
    const [userPassword,setUserPassword]=useState()
    const [confirmUserPassword,setConfirmUserPassword]=useState()
    const [confirmSignUp,setConfirmSignUp]=useState()

    const [emailWarningStyle,setEmailWarningStyle]=useState({color:'red',display:'none'})
    const [emailMatchWarningStyle,setMatchEmailWarningStyle]=useState({color:'red',display:'none'})
    const [passwordWarningStyle,setPasswordWarningStyle]=useState({color:'red',display:'none'})
    const [passwordMatchWarningStyle,setMatchPasswordWarningStyle]=useState({color:'red',display:'none'})
    const [inputEmpty,setInputEmpty]=useState({color:'red',display:'none'})

    const dispatch=useDispatch()
    const navigate=useNavigate()

    const createNewUser=(e)=>{
        e.preventDefault()

        setEmailWarningStyle({color:'red',display:'none'})
        setMatchEmailWarningStyle({color:'red',display:'none'})
        setPasswordWarningStyle({color:'red',display:'none'})
        setMatchPasswordWarningStyle({color:'red',display:'none'})
        setInputEmpty({color:'red',display:'none'})

        const passwordLength=userPassword?.length

        if(passwordLength<8 || passwordLength==null){
            console.log('contrasena es corta')
            setPasswordWarningStyle({color:'red',display:'inline'})
        }

        if(userPassword!=confirmUserPassword){
            console.log('contrasena no coincide')
            setMatchPasswordWarningStyle({color:'red',display:'inline'})
        }

        if(!userMail?.includes('@') || !confirmUserMail?.includes('@')){
            setEmailWarningStyle({color:'red',display:'inline'})
        }

        if(userMail!=confirmUserMail){
            console.log('mail no coincide')
            setMatchEmailWarningStyle({color:'red',display:'inline'})
        }

        if(!userName || !userAge || !userMail || !userPassword || !confirmUserMail || !confirmUserPassword){
            setInputEmpty({color:'red',display:'inline'})
        }

        if(userName && userAge && userMail && userMail===confirmUserMail && passwordLength>=8 && userPassword===confirmUserPassword){
            dispatch(newUser({
                username:userName,
                userage:userAge,
                usermail:userMail,
                userpassword:userPassword
            }))

            setConfirmSignUp(true)


        }


    }

    return(
        <>
        {!confirmSignUp && (
            <div>
                <div>Sign Up</div>
                <form>

                    <label>Name</label>
                    <input type="text" placeholder="Enter your name..." onChange={(e)=>setUserName(e.target.value)} required/>

                    <label>Age</label>
                    <input type="number" placeholder="Enter your age..." onChange={(e)=>setUserAge(e.target.value)} required/>

                    <label>Email</label>
                    <input type="email" placeholder="Enter your email..." onChange={(e)=>setUserMail(e.target.value)} required/>

                    <label>Confirm email</label>
                    <input type="email" placeholder="Enter your email..." onChange={(e)=>setConfirmUserMail(e.target.value)} required/>
                    <p style={emailWarningStyle}>Email needs to have a @</p>
                    <p style={emailMatchWarningStyle}>Email do not match</p>

                    <label>Password</label>
                    <input type="password" placeholder="Enter your password..." minLength="8" onChange={(e)=>setUserPassword(e.target.value)} required/>

                    <label>Confirm password</label>
                    <input type="password" placeholder="Enter your password..." minLength="8" onChange={(e)=>setConfirmUserPassword(e.target.value)} required/>
                    <p style={passwordWarningStyle}>Password needs to be 8 characters or more</p>
                    <p style={passwordMatchWarningStyle}>Password do not match</p>

                    <p style={inputEmpty}>You need to complete all the information in order to sign up</p>

                    <button onClick={createNewUser}>Sign Up</button>
                </form>
                <div>
                    <Link to='/'>
                        <p>Already have an account? click here to Log in...</p>
                    </Link>
                </div>
            </div>
        )}
        {confirmSignUp && (
            <div>
                <div>WELCOME!</div>
                <div>We have send you instruction to confirm your register at your email! </div>
                <Link to='/Login'>
                    <button>Log In</button>
                </Link>
            </div>
        )}

        </>
    )
}

export default SignUp
